INSERT INTO `email_templates` (`id`, `title`, `message`, `type`, `created_at`, `updated_at`) VALUES
(1, 'Unlock 20% Off  Just for You!', 'Hi [First Name],\nWere excited to offer you an exclusive 20% discount on our most popular items! Dont miss out  this special offer is only valid until [Date].\n\nClick below to shop and save:\n[Link Here]\n\nHurry, your discount awaits!', 'Exclusive Discount Offer', '2025-08-12 12:01:24', '2025-08-12 12:01:24');
INSERT INTO `faqs` (`id`, `question`, `answer`, `status`, `seller_id`) VALUES
(5, 'What areas do you deliver to?', 'We currently deliver to Satara, Pune. If your area isnt listed, please contact us, and well try to accommodate your request.', '1', NULL),
(6, 'Do you charge for delivery?', 'We offer free delivery on orders over Rs.199/-', '1', NULL),
(7, 'What is Ecoleaf?', 'Ecoleaf is a fresh-produce delivery project that brings farm-fresh vegetables, fruits, groceries, and natural products directly from farmers to your doorstep.', '1', NULL),
(8, 'What are your delivery timings?', 'We offer multiple delivery slots for your convenience. Please visit the checkout page and choose the time that works best for you.', '1', NULL),
(9, 'Can I track my delivery?', 'Yes, you can track your delivery. Just go to All Orders and select your order to view its status.', '1', NULL),
(10, 'Can I change the delivery address of my order ?', 'At the moment, we dont offer the option to change the delivery address after an order is placed. We can deliver only to the address selected during checkout. However, you may cancel the order before it is out for delivery and place a new order with the correct address.', '1', NULL),
(11, 'What if I don\'t receive my order by the scheduled time?', 'Sometimes, unexpected issues may cause a delay in your delivery. If this happens, our customer support team will inform you about the updated delivery time.', '1', NULL),
(12, 'Can I schedule an order to my convenience?', 'Yes, you can schedule your order at your convenience by choosing from the available delivery slots. However, once an order is placed, it cannot be rescheduled.', '1', NULL);
INSERT INTO `farm_preneurs` (`id`, `name`, `address`, `total_area`, `area_under_cultivation`, `crop_cycle`, `agriculture_method`, `farmer_information`, `images`, `created_at`, `updated_at`) VALUES
(6, 'Samir Kadam', 'Nigadi', '5 Acre', '2 Acre', 'Lady finger', 'Modern & Traditional', 'Samir Kadam is a dedicated farmer associated with Ecoleaf, cultivating vegetables with care and consistency. His farm focuses on growing lady finger and onion on 2 acres of land, supplying fresh produce directly from the farm to Ecoleaf customers.\r\n\r\nFarming Approach\r\nThe cultivation follows a balanced combination of modern and traditional agricultural methods, allowing natural farming practices to work alongside improved techniques for better farm management.\r\n\r\n	Use of traditional farming knowledge passed through generation\r\n	Adoption of modern tools and practices where suitable\r\n	Focus on soil care, crop rotation, and timely harvesting\r\n\r\nFrom Farm to Home\r\nVegetables grown on Samir Kadams farm are harvested and supplied to Ecoleaf to help shorten the journey between the farm and your home. This approach supports freshness, traceability, and a closer connection between farmers and customers.\r\n\r\nEcoleaf Promise\r\nBy connecting customers directly with farmers like Samir Kadam, Ecoleaf aims to build trust, support local agriculture, and deliver farm-fresh vegetables straight to your doorstep.\r\nFrom Samir Kadams farm to your home  a journey rooted in care and transparency.', '[\"https:\\/\\/admin.ecofresh.in\\/storage\\/farm_preneurs\\/1768456954_2214.jpeg\",\"https:\\/\\/admin.ecofresh.in\\/storage\\/farm_preneurs\\/1768540754_97977.jpeg\",\"https:\\/\\/admin.ecofresh.in\\/storage\\/farm_preneurs\\/1768540844_38512.jpeg\"]', '2026-01-15 11:32:34', '2026-01-17 12:20:31'),
(7, 'Milind Kharat', 'Ozarde', '3.5', '1.5', 'Goose Berry / Golden Berry', 'Modern & Traditional', 'Milind Kharat is a committed farmer associated with EcoLeaf, nurturing gooseberry crops with patience, care, and dedication. His farm is focused on cultivating high-quality gooseberries, ensuring naturally grown produce that meets EcoLeafs freshness standards.\r\n\r\nFarming Approach\r\n\r\nThe cultivation process blends traditional wisdom with practical modern farming techniques, helping maintain soil health while improving crop quality and yield.\r\n\r\n Use of traditional farming practices passed down through generations\r\n Careful adoption of modern methods for efficient cultivation\r\n Strong focus on soil nourishment, plant health, and timely harvesting\r\n\r\nFrom Farm to Home\r\n\r\nGooseberries grown on Milind Kharats farm are carefully harvested and supplied directly to EcoLeaf, reducing unnecessary handling and travel time. This ensures freshness, quality, and traceability from the farm to your home.\r\n\r\nEcoLeaf Promise\r\n\r\nBy partnering with farmers like Milind Kharat, EcoLeaf supports local agriculture while delivering farm-fresh, trustworthy produce to customers.\r\n\r\n From Milind Kharats gooseberry farm to your home  naturally grown, honestly delivered.', '[\"https:\\/\\/admin.ecofresh.in\\/storage\\/farm_preneurs\\/1769163134_29022.jpeg\",\"https:\\/\\/admin.ecofresh.in\\/storage\\/farm_preneurs\\/1769163134_77594.jpeg\"]', '2026-01-23 15:42:14', '2026-01-23 15:51:45');
