(81, 1, 835, 'Ragi Whole', '', 0, 0, 'ragi-whole-1-1-1-1-1-1', 6, '5', NULL, NULL, '0', 0, 0, 'null', 'products/1756124214_37141.jpg', NULL, '<p><strong data-start=\"104\" data-end=\"159\">Ragi Whole&nbsp;</strong><br data-start=\"159\" data-end=\"162\">Naturally wholesome and power-packed, Ragi (Finger Millet) is a traditional superfood for modern healthy living. Rich in calcium, iron, fiber, and essential amino acids, Ragi supports strong bones, improves digestion, manages weight, and helps control blood sugar levels. Its earthy flavor and nutrient density make it perfect for porridges, dosas, rotis, laddus, and baked recipes. From farm to table purity &mdash; nourish your family with the goodness of Ragi Whole.</p>', 1, 0, 0, 'packet', 0, 0, 1000, 0, '', '', '2025-08-25 17:46:54', '2025-10-15 14:03:10', NULL, '', '', '', '', '5', 0),
(83, 1, 1281, 'Indrayani Rice*|* ', '', 0, 0, 'indrayani-rice-1-1-1-1-1', 6, '5', NULL, NULL, '0', 1, 1, '2', 'products/1766053420_32305.jpg', NULL, '<p><strong data-start=\"82\" data-end=\"137\">Indrayani Rice&nbsp;</strong><br data-start=\"137\" data-end=\"140\">Indrayani Rice is a premium quality, aromatic variety native to Maharashtra, known for its natural fragrance, soft texture, and rich taste. With its medium grains and slightly sticky consistency after cooking, it&rsquo;s perfect for daily meals, pulao, khichdi, and traditional Maharashtrian dishes. Packed with essential nutrients and easy to digest, Indrayani Rice not only satisfies your taste buds but also supports wholesome nutrition. Bring home the purity of&nbsp; Indrayani Rice &mdash; straight from farm to plate, filled with authentic aroma and goodness.</p>', 1, 1, 2, 'loose', 0, 1, 1000, 0, '', 'GRG0012', '2025-08-25 18:24:20', '2025-12-18 15:53:41', NULL, '', '', '', '', '5', 0),
(84, 1, 1154, 'Sunflower Oil*|* ', '', 0, 0, 'sunflower-oil-1-1-1', 18, '5', NULL, NULL, '0', 0, 1, '2', 'products/1760516364_71791.jpg', NULL, '<p data-start=\"172\" data-end=\"231\"><strong data-start=\"172\" data-end=\"229\">Sunflower Oil&nbsp;</strong></p>\r\n<p data-start=\"233\" data-end=\"949\">Sunflower Oil is a premium quality, cold-pressed oil extracted from organically grown sunflower seeds, known for its light texture, mild taste, and rich nutritional value. Naturally packed with Vitamin E and essential fatty acids, it helps promote heart health, supports glowing skin, and boosts overall immunity. With its high smoke point and neutral flavor, it is ideal for everyday cooking &mdash; from stir-fries and saut&eacute;s to deep-frying and baking. Free from preservatives and chemicals, Sunflower Oil brings you pure nourishment and wellness in every drop. Bring home the goodness of&nbsp; Sunflower Oil &mdash; straight from nature to your kitchen, filled with purity, health, and authentic taste.&nbsp;</p>', 1, 1, 0, 'packet', 0, 0, 1000, 0, '', 'CPO0001', '2025-08-28 18:32:25', '2025-11-30 11:03:44', NULL, '', '', '', '', '5', 0),
(85, 1, 1155, 'Groundnut Oil*|* ', '', 0, 0, 'groundnut-oil-1-1-1', 18, '5', NULL, NULL, '0', 0, 1, '2', 'products/1760513437_62871.jpg', NULL, '<p data-start=\"85\" data-end=\"144\"><strong data-start=\"85\" data-end=\"142\">Groundnut Oil</strong></p>\r\n<p data-start=\"146\" data-end=\"567\">Groundnut Oil is a premium cold-pressed oil extracted from organically grown groundnuts, renowned for its rich aroma, nutty flavor, and wholesome nutrition. Packed with heart-healthy monounsaturated fats, plant sterols, and essential antioxidants, it helps support cardiovascular wellness, enhances immunity, and promotes overall vitality. Naturally rich in Vitamin E, it also nourishes skin and boosts energy.</p>\r\n<p data-start=\"569\" data-end=\"866\">With its high smoke point and distinctive taste, Groundnut Oil is perfect for a variety of cooking styles &mdash; from traditional Indian curries and deep-frying to saut&eacute;ing and roasting. Free from chemicals and preservatives, it ensures every drop is filled with purity and natural goodness.</p>\r\n<p data-start=\"868\" data-end=\"1035\">Bring home the authentic taste and strength of&nbsp; Groundnut Oil &mdash; straight from nature to your kitchen, offering health, flavor, and nourishment in every meal.</p>', 1, 1, 0, 'packet', 0, 0, 1000, 0, '', 'CPO0002', '2025-08-29 16:56:26', '2025-11-30 11:04:04', NULL, '', '', '', '', '5', 0),
(87, 1, 1321, 'Coconut Oil*|* ', '', 0, 0, 'coconut-oil-1-1-1', 18, '5', NULL, NULL, '0', 0, 1, '2', 'products/1760507750_89600.jpg', NULL, '<p data-start=\"91\" data-end=\"144\"><strong data-start=\"91\" data-end=\"142\">Coconut Oil&nbsp;</strong></p>\r\n<p data-start=\"146\" data-end=\"547\">Coconut Oil is a premium cold-pressed oil extracted from organically grown coconuts, cherished for its natural aroma, smooth texture, and rich nutritional benefits. Packed with healthy medium-chain fatty acids (MCFAs) and Vitamin E, it helps boost energy, strengthen immunity, and support heart health. Its nourishing properties also promote healthy skin, strong hair, and overall wellness.</p>\r\n<p data-start=\"549\" data-end=\"798\">Versatile in use, Coconut Oil is perfect for everyday cooking, baking, and frying, as well as for traditional skin and hair care rituals. Free from chemicals, preservatives, and refining, it brings you 100% natural goodness in every drop.</p>\r\n<p data-start=\"800\" data-end=\"971\">Bring home the purity and care of&nbsp; Coconut Oil &mdash; straight from nature to your kitchen and wellness routine, filled with authentic taste, health, and nourishment.</p>', 1, 1, 0, 'packet', 0, 0, 1000, 0, '', 'CPO0003', '2025-08-29 18:29:49', '2025-12-26 16:38:43', NULL, '', '', '', '', '5', 0);
