(138, 1, 1452, 'Lima Beans*|*', '', 0, 0, 'lima-beans-1-1-1-1-1', 1, '1', NULL, 'null', '0', 1, 1, '4', 'products/1769882747_12259.jpg', NULL, '<p>Lima beans, also known as <strong data-start=\"215\" data-end=\"231\">butter beans</strong>, are flat, kidney-shaped beans that can be pale green, cream, or speckled. They grow in pods on climbing or bushy plants and are widely cultivated in warm climates. Lima beans are eaten both fresh (as green beans) and dried (as pulses).</p>', 1, 1, 1, 'packet', 0, 1, 1000, 0, '', 'VEG0027', '2026-01-31 23:35:47', '2026-02-02 17:44:11', NULL, '', '', '', '', '1', 0),
(139, 1, 1430, 'Colocasia leaves*|*  ', '', 0, 0, 'colocasia-leaves-1-1', 1, '1', NULL, 'null', '0', 1, 1, '4', 'products/1769883400_12753.jpg', NULL, '<p>Colocasia leaves are large, heart-shaped, and green, commonly used as a leafy vegetable in many cuisines. They grow on the colocasia (taro) plant, which also produces edible corms (tubers). The leaves have a slightly coarse texture and a mild, earthy flavor.</p>', 1, 1, 0, 'packet', 0, 1, 1000, 0, '', 'VEG0028', '2026-01-31 23:46:40', '2026-02-02 15:08:04', NULL, '', '', '', '', '1', 0),
(140, 1, 1449, 'Potato super saver', '', 0, 0, 'potato-super-saver-1-1', 1, '0', NULL, 'null', '0', 0, 1, '4', 'products/1769919383_21962.jpg', NULL, '<p>Potato &mdash; the humble underground superstar of the vegetable world. </p>\r\n<p>It&rsquo;s a starchy tuber from the plant Solanum tuberosum, native to South America, but now loved in every corner of the globe. Boil it, mash it, fry it, roast it &mdash; it shapeshifts into comfort food in a thousand ways, from French fries to samosas. Nutritionally, it&rsquo;s a good source of carbs, potassium, vitamin C, and fiber (if you keep the skin).</p>', 1, 1, 0, 'packet', 0, 1, 2, 0, '', '', '2026-02-01 09:46:23', '2026-02-02 16:50:03', NULL, '', '', '', '', '0', 1);
