its soft green leaves and mild, spinach-like taste. It is rich in iron, calcium, potassium, fiber, and vitamins A, C, and K, which help improve digestion, strengthen bones, boost immunity, and support healthy blood levels. Hara Maath is easy to digest, quick to cook, and commonly prepared as a simple bhaji, stir-fried with garlic and spices, or added to dal and soups. It is a fast-growing crop that thrives in warm climates and is popular for its nutrition, affordability, and everyday use in Indian households.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"z-0 flex min-h-[46px] justify-start\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</article>\r\n</div>\r\n<div class=\"pointer-events-none h-px w-px absolute bottom-0\" aria-hidden=\"true\" data-edge=\"true\">&nbsp;</div>', 1, 1, 1, 'packet', 0, 1, 1000, 0, '', 'VEG0030', '2026-02-01 21:22:30', '2026-02-02 11:51:22', NULL, '', '', '', '', '1', 0),
(145, 1, 1451, 'Raw banana*|* ', '', 0, 0, 'raw-banana-1-1', 2, '1', NULL, 'null', '0', 1, 1, '4', 'products/1769962145_64429.jpg', NULL, '<div class=\"flex flex-col text-sm\">\r\n<article class=\"text-token-text-primary w-full focus:outline-none [--shadow-height:45px] has-data-writing-block:pointer-events-none has-data-writing-block:-mt-(--shadow-height) has-data-writing-block:pt-(--shadow-height) [&amp;:has([data-writing-block])&gt;*]:pointer-events-auto scroll-mt-[calc(var(--header-height)+min(200px,max(70px,20svh)))]\" dir=\"auto\" tabindex=\"-1\" data-turn-id=\"request-WEB:be8e5101-ebd4-487e-9ceb-807d2df8cf74-8\" data-testid=\"conversation-turn-18\" data-scroll-anchor=\"true\" data-turn=\"assistant\">\r\n<div class=\"text-base my-auto mx-auto pb-10 [--thread-content-margin:--spacing(4)] @w-sm/main:[--thread-content-margin:--spacing(6)] @w-lg/main:[--thread-content-margin:--spacing(16)] px-(--thread-content-margin)\">\r\n<div class=\"[--thread-content-max-width:40rem] @w-lg/main:[--thread-content-max-width:48rem] mx-auto max-w-(--thread-content-max-width) flex-1 group/turn-messages focus-visible:outline-hidden relative flex w-full min-w-0 flex-col agent-turn\" tabindex=\"-1\">\r\n<div class=\"flex max-w-full flex-col grow\">\r\n<div class=\"min-h-8 text-message relative flex w-full flex-col items-end gap-2 text-start break-words whitespace-normal [.text-message+&amp;]:mt-1\" dir=\"auto\" data-message-author-role=\"assistant\" data-message-id=\"7669163b-4328-4a43-8183-c176318bac88\" data-message-model-slug=\"gpt-5-2\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[1px]\">\r\n<div class=\"markdown prose dark:prose-invert w-full wrap-break-word light markdown-new-styling\">\r\n<p data-start=\"0\" data-end=\"523\" data-is-last-node=\"\" data-is-only-node=\"\"><strong data-start=\"0\" data-end=\"29\" data-is-only-node=\"\">Raw banana (Green banana)</strong> is an unripe banana widely used as a vegetable in Indian cooking. It is rich in dietary fiber, resistant starch, potassium, and vitamins B6 and C, which help improve digestion, control blood sugar levels, and support heart health. Raw banana is low in fat, keeps you full for longer, and is especially beneficial for gut health. It is commonly used in sabzi, curries, chips, kofta, and stir-fries, and has a mild taste that absorbs spices well, making it a versatile and nutritious ingredient.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"z-0 flex min-h-[46px] justify-start\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</article>\r\n</div>\r\n<div class=\"pointer-events-none h-px w-px absolute bottom-0\" aria-hidden=\"true\" data-edge=\"true\">&nbsp;</div>', 1, 1, 1, 'packet', 0, 1, 1000, 0, '', 'FRU0015', '2026-02-01 21:39:05', '2026-02-02 17:41:12', NULL, '', '', '', '', '1', 0),
(146, 1, 1418, 'Green Brinjal', '', 0, 0, 'green-brinjal', 1, '1', NULL, NULL, '0', 1, 1, '4', 'products/1770016032_59281.jpg', NULL, '<p>Green brinjal, also known as green eggplant, is a variety of <em data-start=\"61\" data-end=\"80\">Solanum melongena</em> widely used in cooking due to its mild flavor and tender texture. It has light to dark green skin and comes in different shapes, such as round, oval, or long. Green brinjal is low in calories and rich in dietary fiber, vitamins, minerals, and antioxidants, making it a healthy vegetable choice. It absorbs spices and flavors well, which makes it ideal for curries, stir-fries, stuffed dishes, and traditional recipes. It is also valued for its easy digestibility and nutritional benefits, including support for heart health and digestion.</p>', 1, 1, 1, 'packet', 0, 1, 1000, 0, '', 'VEG0031', '2026-02-02 12:37:12', '2026-02-02 12:37:12', NULL, '', '', '', '', '1', 0);
