INSERT INTO `why_ecoleaf` (`id`, `title`, `img`, `description`, `created_at`, `updated_at`) VALUES
(3, 'We empower farmers', 'https://admin.ecofresh.in/storage/why_ecoleaf/1762343659_24284.jpg', 'We begin by training farmers in modern organic farming techniques and offering expert guidance on soil testing & crop planning.', '2025-11-05 14:12:38', '2025-11-05 17:24:19'),
(4, 'Supplying Right Inputs', 'https://admin.ecofresh.in/storage/why_ecoleaf/1762343822_9777.jpg', 'Farmers receive organic inputs at fair prices with complete information, ensuring sustainable and chemical-free\r\nfarming.', '2025-11-05 14:19:40', '2025-11-05 17:27:02'),
(5, 'Farm to Collection', 'https://admin.ecofresh.in/storage/why_ecoleaf/1762344040_42374.jpg', 'Fresh fruits and vegetables are collected directly from the farmers fields, ensuring fair value for farmers and pure produce for you.', '2025-11-05 14:22:05', '2025-11-05 17:30:40'),
(6, 'Quality First', 'https://admin.ecofresh.in/storage/why_ecoleaf/1762344198_57398.jpg', 'Every batch goes through a careful cleaning process, followed by sorting to select only the best-quality produce.', '2025-11-05 14:27:32', '2025-11-05 17:33:18'),
(7, 'Safe Packaging', 'https://admin.ecofresh.in/storage/why_ecoleaf/1762344419_51334.jpg', 'The sorted fruits and vegetables are packed with care, keeping freshness and nutrition intact.', '2025-11-05 14:33:03', '2025-11-05 17:36:59'),
(8, 'Direct to Your Doorstep', 'https://admin.ecofresh.in/storage/why_ecoleaf/1762344588_6816.jpg', 'Finally, these pure and natural products are delivered directly to your home, connecting you straight to the farmers.', '2025-11-05 14:44:16', '2025-11-07 10:01:30');
